import React from "react";
import styled from "styled-components";

import "./style.css";
const cnst_bg = require("../../../assets/cnst_bg6.jpg").default;

const Input = styled.input`
  width: 90%;
  height: 50px;
  padding: 5px;
  margin-top: 30px;
  border: 0;
  border-bottom: 1px solid;
  outline: none;
  font-size: 20px;

  input::-webkit-outer-spin-button,
  input::-webkit-inner-spin-button {
    -webkit-appearance: none;
    margin: 0;
  }
`;

const Form = styled.div`
  height: 450px;
  width: 400px;
  background-color: white;
  margin-top: 5%;
`;

const Main = styled.div`
  position: absolute;
  text-align: center;
  justify-content: center;
  align-items: center;
  color: white;
  background-image: url(${cnst_bg});
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  height: 70%;
`;

const Construction = () => {
  return (
    <div className="justify-content-center row">
      {/* <img src={cnst_bg} style={styles.image} /> */}
      <div
        className="row"
        style={{
          position: "absolute",
          textAlign: "center",
          justifyContent: "center",
          alignItems: "center",
          color: "white",
          backgroundImage: `url(${cnst_bg})`,
          backgroundRepeat: "no-repeat",
          backgroundPosition: "center",
          backgroundSize: "cover",
          height: "70%",
          // marginTop: "10%",
        }}
      >
        <div style={{ justifyContent: "space-around", display: "flex" }}>
          <div>
            <p style={{ fontSize: 45, fontWeight: "bold", marginTop: "10%" }}>
              We build quality Homes
            </p>
            <p style={{ fontSize: 25 }}>100% Hassle-Free and managed by us!</p>
          </div>
          <Form>
            <Input placeholder="Your name" type="text" />
            <Input placeholder="Your contact number" type="numbers" />
            <Input placeholder="Your email" type="email" />
            <Input placeholder="Your city" type="text" />
          </Form>
        </div>
      </div>
    </div>
  );
};

export default Construction;

